import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import "./components/ageVar/ageVar.js";
class AgeVar extends React.Component {
  render() {
    return (
      <div>
        <h1>Hello</h1>
      </div>
    );
  }
}
function App() {
  return (
    <div>
      <AgeVar></AgeVar>
      <Router>
        <div>
          <p>Hello Group Project</p>
        </div>
      </Router>
    </div>
  );
}

export default App;
